selector_to_html = {"a[href=\"potenser.html#potenser\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">1.7. </span>Potenser<a class=\"headerlink\" href=\"#potenser\" title=\"Permalink til denne overskrift\">#</a></h1><p>Potenser er ogs\u00e5 tal, som du l\u00e6rte om i folkeskolen. Potenser er blot en m\u00e5de at forkorte regner\u00e6kke hvor samme tal ganges sammen flere gange.</p>", "a[href=\"#multiplikation-og-division-med-negative-tal\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">1.1.2.2. </span>Multiplikation og division med negative tal<a class=\"headerlink\" href=\"#multiplikation-og-division-med-negative-tal\" title=\"Permalink til denne overskrift\">#</a></h3><p>Regnereglerne ovenfor er liges\u00e5 meget en p\u00e5mindelse om, hvordan vi skriver produkter og kvotienter. Hvis vi for eksempel har en ligning <span class=\"math notranslate nohighlight\">\\(2x+4=1\\)</span>, s\u00e5 skriver vi jo ikke <span class=\"math notranslate nohighlight\">\\(2\\cdot x\\)</span>, men blot <span class=\"math notranslate nohighlight\">\\(2x\\)</span>. Ligeledes, s\u00e5 skriver vi <span class=\"math notranslate nohighlight\">\\(\\frac{x}{2}\\)</span> eller <span class=\"math notranslate nohighlight\">\\(\\frac{1}{2}x\\)</span> i stedet for <span class=\"math notranslate nohighlight\">\\(x : 2\\)</span>.</p><p>Punkt 1. fra <a class=\"reference internal\" href=\"#negativetalmogd\">Regneregler 1.2</a> siger vi ofte som \u00bbnoget negativt gange noget positivt giver noget negativt\u00ab eller \u00bbminus gange plus giver minus\u00ab. Punkt 2. siger vi ofte som \u00bbnoget negativt gange noget negativt giver noget positivt\u00ab eller \u00bbminus gange minus giver plus\u00ab. Det samme kan vi sige ved division. Bem\u00e6rk ogs\u00e5 i punkt 3., at det er ligegyldigt, om det negative tal er i t\u00e6lleren eller i n\u00e6vneren, uanset hvad vil resultatet v\u00e6re noget negativt.</p>", "a[href=\"#tallet-0-og-negative-tal\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">1.1. </span>Tallet 0 og negative tal<a class=\"headerlink\" href=\"#tallet-0-og-negative-tal\" title=\"Permalink til denne overskrift\">#</a></h1><h2><span class=\"section-number\">1.1.1. </span>Tallet 0<a class=\"headerlink\" href=\"#tallet-0\" title=\"Permalink til denne overskrift\">#</a></h2><p>Hvis du ikke har nogle bananer, s\u00e5 kan vi kvantificere det til, at du har nul bananer. Nul er tallet for <em>ingenting</em>. Det er et meget vigtigt tal for b\u00e5de talteorien og m\u00e6ngdeteorien. Nul er det, der adskiller alle positive og negative tal fra hinanden og nul b\u00e6rer egenskaber, som vi kommer til at bruge til at bevise nogle af de s\u00e6tninger, som du skal l\u00e6re her. Vi har samlet nogle af egenskaberne nedenfor:</p>", "a[href=\"#opgaver\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">1.1.3. </span>Opgaver<a class=\"headerlink\" href=\"#opgaver\" title=\"Permalink til denne overskrift\">#</a></h2>", "a[href=\"#addition-og-subtraktion-med-negative-tal\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">1.1.2.1. </span>Addition og subtraktion med negative tal<a class=\"headerlink\" href=\"#addition-og-subtraktion-med-negative-tal\" title=\"Permalink til denne overskrift\">#</a></h3><p>Husk, at n\u00e5r vi l\u00e6gger noget til (addition), s\u00e5 svarer det til at g\u00e5 til h\u00f8jre p\u00e5 tallinjen, og n\u00e5r vi tr\u00e6kker noget fra (subtraktion), s\u00e5 svarer det til at g\u00e5 til venstre p\u00e5 tallinjen.</p>", "a[href=\"#nulegenskab\"]": "<div class=\"proof egenskaber admonition\" id=\"nulegenskab\">\n<p class=\"admonition-title\"><span class=\"caption-number\">Egenskaber 1.1 </span></p>\n<section class=\"egenskaber-content\" id=\"proof-content\">\n<p>For et vilk\u00e5rligt tal <span class=\"math notranslate nohighlight\">\\(a\\)</span> har <span class=\"math notranslate nohighlight\">\\(0\\)</span> f\u00f8lgende egenskaber:</p>\n<ol class=\"arabic\">\n<li><div class=\"math notranslate nohighlight\" id=\"equation-nulreglen\">\n<span class=\"eqno\">(1.1)<a class=\"headerlink\" href=\"#equation-nulreglen\" title=\"Permalink til denne ligning\">#</a></span>\\[a + (-a) = 0 \\]</div>\n</li>\n<li><div class=\"math notranslate nohighlight\">\n\\[a + 0 = a\\]</div>\n</li>\n<li><div class=\"math notranslate nohighlight\">\n\\[a \\cdot 0 = 0\\]</div>\n</li>\n</ol>\n</section>\n</div>", "a[href=\"#tallet-0\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">1.1.1. </span>Tallet 0<a class=\"headerlink\" href=\"#tallet-0\" title=\"Permalink til denne overskrift\">#</a></h2><p>Hvis du ikke har nogle bananer, s\u00e5 kan vi kvantificere det til, at du har nul bananer. Nul er tallet for <em>ingenting</em>. Det er et meget vigtigt tal for b\u00e5de talteorien og m\u00e6ngdeteorien. Nul er det, der adskiller alle positive og negative tal fra hinanden og nul b\u00e6rer egenskaber, som vi kommer til at bruge til at bevise nogle af de s\u00e6tninger, som du skal l\u00e6re her. Vi har samlet nogle af egenskaberne nedenfor:</p>", "a[href=\"#equation-nulreglen\"]": "<div class=\"math notranslate nohighlight\" id=\"equation-nulreglen\">\n\\[a + (-a) = 0 \\]</div>", "a[href=\"#negativetalmogd\"]": "<div class=\"proof regneregler admonition\" id=\"negativetalmogd\">\n<p class=\"admonition-title\"><span class=\"caption-number\">Regneregler 1.2 </span> (Multiplikation og division)</p>\n<section class=\"regneregler-content\" id=\"proof-content\">\n<p>Lad <span class=\"math notranslate nohighlight\">\\(a\\)</span> og <span class=\"math notranslate nohighlight\">\\(b\\)</span> v\u00e6re vilk\u00e5rlige tal, da g\u00e6lder</p>\n<ol class=\"arabic simple\">\n<li><p><span class=\"math notranslate nohighlight\">\\(a \\cdot (-b) = -ab\\)</span></p></li>\n<li><p><span class=\"math notranslate nohighlight\">\\(-a \\cdot (-b) = ab\\)</span></p></li>\n<li><p><span class=\"math notranslate nohighlight\">\\(\\frac{-a}{b} = \\frac{a}{-b} = -\\frac{a}{b}\\)</span></p></li>\n<li><p><span class=\"math notranslate nohighlight\">\\(\\frac{-a}{-b} = \\frac{a}{b}\\)</span></p></li>\n</ol>\n</section>\n</div>", "a[href=\"#nulreglen-eksempel2\"]": "<div class=\"proof eksempel admonition\" id=\"nulreglen-eksempel2\">\n<p class=\"admonition-title\"><span class=\"caption-number\">Eksempel 1.2 </span> (\u00bbMinus gange minus giver plus\u00ab)</p>\n<section class=\"eksempel-content\" id=\"proof-content\">\n<p>Lad os forts\u00e6tte med, at <span class=\"math notranslate nohighlight\">\\(a=6\\)</span> og <span class=\"math notranslate nohighlight\">\\(b=8\\)</span>. Fra punkt 2. i <a class=\"reference internal\" href=\"#negativetalmogd\">Regneregler 1.2</a> har vi, at <span class=\"math notranslate nohighlight\">\\(-6\\cdot(-8)=48\\)</span>, hvilket giver et positivt resultat. Men hvorfor?</p>\n<p>Vi ved stadig, at <span class=\"math notranslate nohighlight\">\\(8+(-8)=0\\)</span> fra <a class=\"reference internal\" href=\"#equation-nulreglen\">(1.1)</a>. Punkt 3. fra <a class=\"reference internal\" href=\"#nulegenskab\">Egenskaber 1.1</a> giver</p>\n<div class=\"math notranslate nohighlight\">\n\\[    -6 \\cdot (8 + (-8)) = -6 \\cdot 0 = 0.\\]</div>\n<p>Ganger vi p\u00e5 samme tid -6 ind i parentesen, s\u00e5 f\u00e5r vi, at</p>\n<div class=\"math notranslate nohighlight\">\n\\[    -6 \\cdot (8 + (-8)) = \\underbrace{-6\\cdot 8}_{=-48} -6 \\cdot (-8) = 0.\\]</div>\n<p>Vi ser, at <span class=\"math notranslate nohighlight\">\\(-48-6\\cdot(-8) = 0\\)</span>, og den eneste m\u00e5de det g\u00e6lder, er hvis <span class=\"math notranslate nohighlight\">\\(-6 \\cdot (-8) = 48\\)</span> if\u00f8lge <a class=\"reference internal\" href=\"#equation-nulreglen\">(1.1)</a>.</p>\n</section>\n</div>", "a[href=\"#negative-tal\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">1.1.2. </span>Negative tal<a class=\"headerlink\" href=\"#negative-tal\" title=\"Permalink til denne overskrift\">#</a></h2><p>De negative tal skal repr\u00e6sentere id\u00e9en om modsatte tal. Hvis du f\u00e5r penge ind, s\u00e5 er det modsatte at give penge v\u00e6k. Den pengestr\u00f8m kan beskrives i to modsatte bev\u00e6gelser. Hvis du f\u00e5r penge ind, s\u00e5 bliver din bankkonto st\u00f8rre, og hvis du giver penge v\u00e6k, s\u00e5 bliver din bankkonto mindre. Denne str\u00f8m kan nedskrives matematisk med brugen af negative tal, og netop derfor er de s\u00e5 anvendelige. De finder sig faktisk ogs\u00e5 anvendelige p\u00e5 temperaturskalaerne.</p><p>Lad os vende tilbage til begrebet <em>modsatte tal</em>. Det modsatte tal af <span class=\"math notranslate nohighlight\">\\(4\\)</span> er <span class=\"math notranslate nohighlight\">\\(-4\\)</span>, og det ved vi som en konsekvens af nulreglen. Hvad er det modsatte tal af <span class=\"math notranslate nohighlight\">\\(-2\\)</span>? Igen kan vi bruge nulreglen til at vise, at det modsatte tal af <span class=\"math notranslate nohighlight\">\\(-2\\)</span> er <span class=\"math notranslate nohighlight\">\\(2\\)</span>. Derfor har vi f\u00f8lgende definition af et modsat tal:</p>", "a[href=\"#nulreglen-eksempel1\"]": "<div class=\"proof eksempel admonition\" id=\"nulreglen-eksempel1\">\n<p class=\"admonition-title\"><span class=\"caption-number\">Eksempel 1.1 </span> (\u00bbMinus gange plus giver minus\u00ab)</p>\n<section class=\"eksempel-content\" id=\"proof-content\">\n<p>Lad os sige, at <span class=\"math notranslate nohighlight\">\\(a=6\\)</span> og <span class=\"math notranslate nohighlight\">\\(b=8\\)</span>. Fra punkt 1. i <a class=\"reference internal\" href=\"#negativetalmogd\">Regneregler 1.2</a> har vi, at <span class=\"math notranslate nohighlight\">\\(6\\cdot(-8)=-48\\)</span>, hvilket giver et negativt resultat. Men hvorfor?</p>\n<p>Vi ved, at <span class=\"math notranslate nohighlight\">\\(8+(-8)=0\\)</span> fra <a class=\"reference internal\" href=\"#equation-nulreglen\">(1.1)</a>. Bruger vi punkt 3. fra <a class=\"reference internal\" href=\"#nulegenskab\">Egenskaber 1.1</a>, s\u00e5 har vi ogs\u00e5, at</p>\n<div class=\"math notranslate nohighlight\">\n\\[    6 \\cdot (8 + (-8)) = 6 \\cdot 0 = 0.\\]</div>\n<p>Ganger vi p\u00e5 samme tid 6 ind i parentesen, s\u00e5 f\u00e5r vi, at</p>\n<div class=\"math notranslate nohighlight\">\n\\[    6 \\cdot (8 + (-8)) = \\underbrace{6\\cdot 8}_{=48} + 6 \\cdot (-8) = 0.\\]</div>\n<p>Vi ser, at <span class=\"math notranslate nohighlight\">\\(48+6\\cdot(-8) = 0\\)</span>, og den eneste m\u00e5de det g\u00e6lder, er hvis <span class=\"math notranslate nohighlight\">\\(6 \\cdot (-8) = -48\\)</span> if\u00f8lge <a class=\"reference internal\" href=\"#equation-nulreglen\">(1.1)</a>.</p>\n</section>\n</div>", "a[href=\"#modsattal\"]": "<div class=\"proof definition admonition\" id=\"modsattal\">\n<p class=\"admonition-title\"><span class=\"caption-number\">Definition 1.1 </span> (Modsat tal)</p>\n<section class=\"definition-content\" id=\"proof-content\">\n<p>Lad <span class=\"math notranslate nohighlight\">\\(a\\)</span> v\u00e6re et vilk\u00e5rligt tal. Da er <span class=\"math notranslate nohighlight\">\\(b\\)</span> det modsatte tal af <span class=\"math notranslate nohighlight\">\\(a\\)</span>, hvis det opfylder nulreglen</p>\n<div class=\"math notranslate nohighlight\">\n\\[    a + b = 0.\\]</div>\n</section>\n</div>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(` ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,
                onShow(instance) {MathJax.typesetPromise([instance.popper]).then(() => {});},
            });
        };
    };
    console.log("tippy tips loaded!");
};
